      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" <= 3.000000) AND (t."X_2" <= 5.500000)) THEN 13 ELSE NULL END AS Leaf_13,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" <= 3.000000) AND (t."X_2" > 5.500000)) THEN 14 ELSE NULL END AS Leaf_14,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" > 3.000000) AND (t."X_3" <= 6.500000) AND (t."X_35" > 6.500000)) THEN 18 ELSE NULL END AS Leaf_18,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" > 3.000000) AND (t."X_3" <= 6.500000) AND (t."X_35" <= 6.500000) AND (t."X_35" <= 4.500000)) THEN 19 ELSE NULL END AS Leaf_19,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" > 3.000000) AND (t."X_3" <= 6.500000) AND (t."X_35" <= 6.500000) AND (t."X_35" > 4.500000)) THEN 20 ELSE NULL END AS Leaf_20,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" > 3.000000) AND (t."X_3" > 6.500000) AND (t."X_34" > 15.500000) AND (t."X_43" <= 7.000000)) THEN 23 ELSE NULL END AS Leaf_23,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" > 3.000000) AND (t."X_3" > 6.500000) AND (t."X_34" > 15.500000) AND (t."X_43" > 7.000000)) THEN 24 ELSE NULL END AS Leaf_24,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" <= 4.500000) AND (t."X_2" <= 7.000000)) THEN 25 ELSE NULL END AS Leaf_25,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" <= 4.500000) AND (t."X_2" > 7.000000)) THEN 26 ELSE NULL END AS Leaf_26,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" > 3.000000) AND (t."X_3" > 6.500000) AND (t."X_34" <= 15.500000) AND (t."X_3" <= 14.500000)) THEN 27 ELSE NULL END AS Leaf_27,
      CASE WHEN((t."X_54" <= 7.000000) AND (t."X_60" > 4.500000) AND (t."X_44" > 3.000000) AND (t."X_3" > 6.500000) AND (t."X_34" <= 15.500000) AND (t."X_3" > 14.500000)) THEN 28 ELSE NULL END AS Leaf_28
    FROM model_input t
    ) AS t1
    ON(t."index" == t1."index")
 ),
