      CASE WHEN((t."X_34" <= 15.500000) AND (t."X_61" > 8.500000) AND (t."X_61" > 11.500000) AND (t."X_35" > 11.000000) AND (t."X_59" <= 10.500000)) THEN 19 ELSE NULL END AS Leaf_19,
      CASE WHEN((t."X_34" <= 15.500000) AND (t."X_61" > 8.500000) AND (t."X_61" > 11.500000) AND (t."X_35" > 11.000000) AND (t."X_59" > 10.500000) AND (t."X_34" <= 8.000000)) THEN 21 ELSE NULL END AS Leaf_21,
      CASE WHEN((t."X_34" <= 15.500000) AND (t."X_61" > 8.500000) AND (t."X_61" > 11.500000) AND (t."X_35" > 11.000000) AND (t."X_59" > 10.500000) AND (t."X_34" > 8.000000)) THEN 22 ELSE NULL END AS Leaf_22,
      CASE WHEN((t."X_34" <= 15.500000) AND (t."X_61" > 8.500000) AND (t."X_61" > 11.500000) AND (t."X_35" <= 11.000000) AND (t."X_19" > 8.000000) AND (t."X_34" <= 1.000000)) THEN 25 ELSE NULL END AS Leaf_25,
      CASE WHEN((t."X_34" <= 15.500000) AND (t."X_61" > 8.500000) AND (t."X_61" > 11.500000) AND (t."X_35" <= 11.000000) AND (t."X_19" > 8.000000) AND (t."X_34" > 1.000000)) THEN 26 ELSE NULL END AS Leaf_26,
      CASE WHEN((t."X_34" <= 15.500000) AND (t."X_61" <= 8.500000) AND (t."X_18" <= 2.500000)) THEN 27 ELSE NULL END AS Leaf_27,
      CASE WHEN((t."X_34" <= 15.500000) AND (t."X_61" <= 8.500000) AND (t."X_18" > 2.500000) AND (t."X_14" <= 0.500000) AND (t."X_19" > 12.500000)) THEN 32 ELSE NULL END AS Leaf_32,
