   LEFT OUTER JOIN
   "DT_node_data_2" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_3" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_7", t1."Leaf_8", t1."Leaf_13", t1."Leaf_14", t1."Leaf_15", t1."Leaf_17", t1."Leaf_18", t1."Leaf_20", t1."Leaf_24", t1."Leaf_25", t1."Leaf_26", t1."Leaf_27", t1."Leaf_29", t1."Leaf_30", t1."Leaf_31", t1."Leaf_34", t1."Leaf_36", t1."Leaf_37", t1."Leaf_38" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_58" <= 0.500000) AND (t."X_13" > 6.500000) AND (t."X_5" <= 8.500000)) THEN 5 ELSE NULL END AS Leaf_5,
      CASE WHEN((t."X_58" <= 0.500000) AND (t."X_13" > 6.500000) AND (t."X_5" > 8.500000) AND (t."X_34" <= 8.500000)) THEN 7 ELSE NULL END AS Leaf_7,
