      CASE WHEN((t."X_58" > 0.500000) AND (t."X_36" <= 6.000000) AND (t."X_20" > 2.500000) AND (t."X_34" > 7.000000) AND (t."X_58" <= 9.000000)) THEN 17 ELSE NULL END AS Leaf_17,
      CASE WHEN((t."X_58" > 0.500000) AND (t."X_36" <= 6.000000) AND (t."X_20" > 2.500000) AND (t."X_34" > 7.000000) AND (t."X_58" > 9.000000)) THEN 18 ELSE NULL END AS Leaf_18,
      CASE WHEN((t."X_58" > 0.500000) AND (t."X_36" > 6.000000) AND (t."X_34" > 15.500000)) THEN 20 ELSE NULL END AS Leaf_20,
      CASE WHEN((t."X_58" > 0.500000) AND (t."X_36" > 6.000000) AND (t."X_34" <= 15.500000) AND (t."X_2" <= 6.000000) AND (t."X_20" > 7.500000)) THEN 24 ELSE NULL END AS Leaf_24,
      CASE WHEN((t."X_58" > 0.500000) AND (t."X_36" > 6.000000) AND (t."X_34" <= 15.500000) AND (t."X_2" <= 6.000000) AND (t."X_20" <= 7.500000) AND (t."X_60" <= 10.000000)) THEN 25 ELSE NULL END AS Leaf_25,
      CASE WHEN((t."X_58" > 0.500000) AND (t."X_36" > 6.000000) AND (t."X_34" <= 15.500000) AND (t."X_2" <= 6.000000) AND (t."X_20" <= 7.500000) AND (t."X_60" > 10.000000)) THEN 26 ELSE NULL END AS Leaf_26,
      CASE WHEN((t."X_58" > 0.500000) AND (t."X_36" > 6.000000) AND (t."X_34" <= 15.500000) AND (t."X_2" > 6.000000) AND (t."X_61" <= 7.500000)) THEN 27 ELSE NULL END AS Leaf_27,
