      CASE WHEN((t."X_58" > 0.500000) AND (t."X_36" > 6.000000) AND (t."X_34" <= 15.500000) AND (t."X_2" > 6.000000) AND (t."X_61" > 7.500000) AND (t."X_5" > 1.000000)) THEN 30 ELSE NULL END AS Leaf_30,
