      CASE WHEN((t."X_58" <= 0.500000) AND (t."X_13" <= 6.500000) AND (t."X_34" > 8.000000) AND (t."X_3" <= 14.500000) AND (t."X_12" > 7.000000)) THEN 36 ELSE NULL END AS Leaf_36,
      CASE WHEN((t."X_58" <= 0.500000) AND (t."X_13" <= 6.500000) AND (t."X_34" > 8.000000) AND (t."X_3" <= 14.500000) AND (t."X_12" <= 7.000000) AND (t."X_13" <= 0.500000)) THEN 37 ELSE NULL END AS Leaf_37,
      CASE WHEN((t."X_58" <= 0.500000) AND (t."X_13" <= 6.500000) AND (t."X_34" > 8.000000) AND (t."X_3" <= 14.500000) AND (t."X_12" <= 7.000000) AND (t."X_13" > 0.500000)) THEN 38 ELSE NULL END AS Leaf_38
