"DT_output_3" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", t2."P_4" AS "P_4", t2."P_5" AS "P_5", t2."P_6" AS "P_6", t2."P_7" AS "P_7", t2."P_8" AS "P_8", t2."P_9" AS "P_9", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_3" AS t1
   LEFT OUTER JOIN
   "DT_node_data_3" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_4" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_5", t1."Leaf_7", t1."Leaf_9", t1."Leaf_10", t1."Leaf_11", t1."Leaf_12", t1."Leaf_16", t1."Leaf_17", t1."Leaf_18", t1."Leaf_22", t1."Leaf_24", t1."Leaf_25", t1."Leaf_26", t1."Leaf_29", t1."Leaf_30", t1."Leaf_33", t1."Leaf_34", t1."Leaf_35", t1."Leaf_36" ) AS node_id
  FROM
    model_input t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_45" > 13.500000) AND (t."X_59" > 9.000000) AND (t."X_3" <= 12.500000)) THEN 5 ELSE NULL END AS Leaf_5,
      CASE WHEN((t."X_45" > 13.500000) AND (t."X_59" > 9.000000) AND (t."X_3" > 12.500000) AND (t."X_42" <= 2.000000)) THEN 7 ELSE NULL END AS Leaf_7,
      CASE WHEN((t."X_45" > 13.500000) AND (t."X_59" > 9.000000) AND (t."X_3" > 12.500000) AND (t."X_42" > 2.000000) AND (t."X_46" <= 2.500000)) THEN 9 ELSE NULL END AS Leaf_9,
      CASE WHEN((t."X_45" > 13.500000) AND (t."X_59" > 9.000000) AND (t."X_3" > 12.500000) AND (t."X_42" > 2.000000) AND (t."X_46" > 2.500000)) THEN 10 ELSE NULL END AS Leaf_10,
      CASE WHEN((t."X_45" > 13.500000) AND (t."X_59" <= 9.000000) AND (t."X_61" <= 11.500000)) THEN 11 ELSE NULL END AS Leaf_11,
      CASE WHEN((t."X_45" > 13.500000) AND (t."X_59" <= 9.000000) AND (t."X_61" > 11.500000)) THEN 12 ELSE NULL END AS Leaf_12,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" > 15.500000) AND (t."X_41" > 2.500000)) THEN 16 ELSE NULL END AS Leaf_16,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" > 15.500000) AND (t."X_41" <= 2.500000) AND (t."X_1" <= 1.500000)) THEN 17 ELSE NULL END AS Leaf_17,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" > 15.500000) AND (t."X_41" <= 2.500000) AND (t."X_1" > 1.500000)) THEN 18 ELSE NULL END AS Leaf_18,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" > 0.500000) AND (t."X_61" > 11.500000)) THEN 22 ELSE NULL END AS Leaf_22,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" > 0.500000) AND (t."X_61" <= 11.500000) AND (t."X_46" > 1.000000)) THEN 24 ELSE NULL END AS Leaf_24,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" > 0.500000) AND (t."X_61" <= 11.500000) AND (t."X_46" <= 1.000000) AND (t."X_53" <= 8.000000)) THEN 25 ELSE NULL END AS Leaf_25,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" > 0.500000) AND (t."X_61" <= 11.500000) AND (t."X_46" <= 1.000000) AND (t."X_53" > 8.000000)) THEN 26 ELSE NULL END AS Leaf_26,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" <= 0.500000) AND (t."X_18" > 15.500000) AND (t."X_61" <= 9.000000)) THEN 29 ELSE NULL END AS Leaf_29,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" <= 0.500000) AND (t."X_18" > 15.500000) AND (t."X_61" > 9.000000)) THEN 30 ELSE NULL END AS Leaf_30,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" <= 0.500000) AND (t."X_18" <= 15.500000) AND (t."X_46" > 4.000000) AND (t."X_3" <= 15.000000)) THEN 33 ELSE NULL END AS Leaf_33,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" <= 0.500000) AND (t."X_18" <= 15.500000) AND (t."X_46" > 4.000000) AND (t."X_3" > 15.000000)) THEN 34 ELSE NULL END AS Leaf_34,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" <= 0.500000) AND (t."X_18" <= 15.500000) AND (t."X_46" <= 4.000000) AND (t."X_53" <= 7.500000)) THEN 35 ELSE NULL END AS Leaf_35,
      CASE WHEN((t."X_45" <= 13.500000) AND (t."X_51" <= 15.500000) AND (t."X_41" <= 0.500000) AND (t."X_18" <= 15.500000) AND (t."X_46" <= 4.000000) AND (t."X_53" > 7.500000)) THEN 36 ELSE NULL END AS Leaf_36
    FROM model_input t
    ) AS t1
    ON(t."index" == t1."index")
 ),
